import React, { Fragment } from "react";
import MainHeader from "./main.header";
import MainFooter from "./main.footer";
import MainContent from "./main.content";
import MainMenuBar from "./main.menubar";

const MainHOC = (props) => {
  return (
    <Fragment>
      <MainHeader />
      <MainContent />{prop}
      <MainFooter />
    </Fragment>
  );
};
export default MainHOC;
